Terrorism Alert 

Do Not disregard this Alert. A suspect who goes by the name of darkness has been arrested within the past week or so, he is in the Illinois Correctional system. Darkness has signal technology inside of jail and has been constantly ordering hits on me and my family from jail. Darkness implanted me with Two way auditory implants so he could speak to me and listen to my voice. I have signal equipment implanted in my head. The signal chatter I have been listening to has been saying that Darkness blames me for his arrest and he is planning on killing me and my family or They are planning on taking us and putting us on machines. Please recover our remains if any of us are taken. Run the intelligence on Darkness and identify his terror network. Run the contacts he is communicating with and clearly identify all of their locations. The threat is real and imminent. My name is Keith Bieszczat, my family is Wayne Bieszczat, timothy bieszczat and susan Bieszczat.  His terror network also monitors a thought identifier implant implanted in my brain. Darkness is a terrorist. Darkness terrorism network has been taking and kidnapping people and putting them on Life support machines in various locations in the northern Illinois area, they have also been active in Wisconsin. After they abduct the people they place them on machines and chop out their organs selling the organs on the black market. This alert is still being written, I am posting it in case we are killed. Darkness and his terror network have access to time command equipment. They routinely commit home invasions on our property with the time command equipment they have access to. The suspects have been attempting to steal my identity and my clearances. The suspects are trying to steal my clearances. Do not allow the suspects to use my clearances if I am taken hostage or killed. Please secure my clearances immediately.

